Trail.create(name: 'Mason Highland', reservoir: 'barker', description: 'This trail departs the Oxbow Bayou South Side and runs southwest to the asphalt trail off Highland Knolls.  Nice pine forest near the south end of the trail.  Trail is inundated when Barker Reservoir water level exceeds 89’.  Parking is available on the street on the west side of Pattison Elementary School, at the Walgreens at Highland Knolls and Fry Rd or at the south dead-end of Alana Springs Dr.', notes: '', maplink: 'https://www.google.com/maps/place/Mason+Highland,+Katy,+TX+77450/@29.7491301,-95.7142318,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df48e35d02c7:0x415df94500b01ec3!8m2!3d29.7491255!4d-95.7120431')
Trail.create(name: 'Mason Highland Wilderness', reservoir: 'barker', description: 'This trail starts on the east side of the Nottingham Country MUD treatment plant fence, then cuts cross county to the Mason Highland trail.  Trail is inundated when Barker Reservoir water level exceeds 92’.  Trail is inundated when Barker Reservoir water level exceeds 89’.  west side of Pattison Elementary School.', notes: '', maplink: 'https://www.google.com/maps/place/Mason+Highland+Wilderness+Trail,+Katy,+TX+77450/@29.7526883,-95.7122603,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df49f4c88dc9:0x960fbbf0950a675c!8m2!3d29.7526837!4d-95.7100716')
Trail.create(name: 'Oxbow Bayou South Side', reservoir: 'barker', description: 'This trail runs on both sides of the old Mason Creek stream bank levee.  Near the south end there is an old Boy Scout bridge to cross from one side to the other.  Trail is inundated when Barker Reservoir water level exceeds 90’.  Parking is available on the street on the west side of Pattison Elementary School.', notes: '', maplink: 'https://www.google.com/maps/place/Oxbow+Bayou+South+Side+Trail,+Katy,+TX+77450/@29.7503049,-95.7097981,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df365ee9fc37:0xe157111ce9c617bc!8m2!3d29.7503003!4d-95.7076094')
Trail.create(name: 'FFPS Connector', reservoir: 'barker', description: 'This trail runs from the eastern most FFPS soccer field parking lot to the Old Rice Berm trail.  This is cross country, so it can be muddy in wet weather.   It intersects the tree line about 70 yards north of the Westheimer Pkwy ditch.  Parking is available at the eastern most FFPS soccer fields parking lots.', notes: '', maplink: 'https://www.google.com/maps/place/FFPS+Connector+Trail,+Houston,+TX+77082/@29.7309785,-95.7223106,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df689d3e93ef:0xcd825a296e72947c!8m2!3d29.7309739!4d-95.7201219')
Trail.create(name: 'Wilderness', reservoir: 'barker', description: 'This is a relatively short (350 yards/0.20 miles) connection between the FFPS Connector and Old Rice Berm trails.  This is cross country, so it can be muddy in wet weather.  Parking is available at the eastern most FFPS soccer fields parking lots.', notes: '', maplink: 'https://www.google.com/maps/place/Wilderness+Trail,+Houston,+TX+77082/@29.7292503,-95.7175416,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df6eb4f0467d:0xff63742b9117a20d!8m2!3d29.7292457!4d-95.7153529')
Trail.create(name: 'Westheimer Pkwy Connector', reservoir: 'barker', description: 'A short (200 yard/0.11 miles) connection due east-west from the Old Rice Berm and FFPS Connector trails to the Westheimer Parkway ROW.  Parking is available at the eastern most FFPS soccer fields parking lots.', notes: '', maplink: 'https://www.google.com/maps/place/Westheimer+Pkwy+Connector,+Houston,+TX+77082/@29.7283148,-95.7191001,17z/data=!3m1!4b1!4m8!1m2!2m1!1sWestheimer+Pkwy+Connector!3m4!1s0x8640df6eded21f03:0xa39e0d286f696488!8m2!3d29.7283102!4d-95.7169114')
Trail.create(name: 'T103 Cutoff', reservoir: 'barker', description: 'This trail runs due north-south from the Mason Highland trail to the paved trail on the north side  of T103 ditch.  Follows an old roadbed on the north portion.  The south portion runs on the top of a berm.  There are two crossing ditches on the south portion which often have water.  Trail is inundated when Barker Reservoir water level exceeds 87’.  Parking is available on the street on the west side of Pattison Elementary School, at the Walgreens at Highland Knolls and Fry Rd or at the south dead-end of Alana Springs Dr..', notes: '', maplink: 'https://www.google.com/maps/place/T103+Cutoff,+Katy,+TX+77450/@29.7425117,-95.7149935,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df46f31ac55f:0xc131522df6e96b75!8m2!3d29.7425071!4d-95.7128048')
Trail.create(name: 'T103 S', reservoir: 'barker', description: 'This runs on the south bank of T103 ditch from the north end of Old Rice Berm trail to the asphalt trail at the bridge over T103.  Parking is available at the northern most FFPS soccer fields parking lots.', notes: '', maplink: 'https://www.google.com/maps/place/T103+S+Trail,+Katy,+TX+77450/@29.7382345,-95.7171189,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df5cbe25c611:0xb94b463be49a449b!8m2!3d29.7382299!4d-95.7149302')
Trail.create(name: 'Old Rice Berm', reservoir: 'barker', description: 'Roughly parallels west of Buffalo Bayou from Westheimer Pkwy to the south side of T103 ditch.  There are three crossing ditches or low areas which often have water.  One of them has a concrete pipe which is used as a stepping stone to cross the ditch.  One of the lowest elevation trails, the lower (north) portion is inundated when Barker Reservoir water level exceeds 85’.  The higher (south) portion is rarely inundated.  Parking is available at the eastern most FFPS soccer fields parking lots.', notes: '', maplink: 'https://www.google.com/maps/place/Old+Rice+Berm+Trail,+Houston,+TX+77082/@29.7323512,-95.714137,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df6bb402be25:0xc3f6beea63b46dbd!8m2!3d29.7323466!4d-95.7119483')
Trail.create(name: 'Old Oil Field Road', reservoir: 'barker', description: 'This trail runs from Westheimer Pkwy to Buffalo Bayou.  Trail is inundated when Barker Reservoir water level exceeds 89’.  Parking is available at the Fort Bend County Freedom Park parking lots.  Access is from Buffalo Bayou or the east side of the drainage ditch running south from Freedom Park.  The trail crosses this drainage ditch and there is often some water in the ditch.  Lots of gravel on parts of the trail.', notes: '', maplink: 'https://www.google.com/maps/place/Old+Oil+Field+Trail,+Katy,+TX+77450/@29.7241841,-95.7209992,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df7004aa8911:0x40b56f8b7c6aded8!8m2!3d29.7241795!4d-95.7188105')
Trail.create(name: 'Bayou View', reservoir: 'barker', description: 'This trail runs parallel to Buffalo Bayou and offers a lot more shade than the bayou bank trail.  Usually done in conjunction with the Old Oil Field Road trail.  Nice wetlands between this trail and Buffalo Bayou.  Parking is available at the Fort Bend County Freedom Park parking lots.  Trail is inundated when Barker Reservoir water level exceeds 89’. ', notes: '', maplink: 'https://www.google.com/maps/place/Bayou+View+Trail,+Katy,+TX+77450/@29.720434,-95.7232855,17z/data=!3m1!4b1!4m5!3m4!1s0x8640df7a6eea3777:0x14ac950b1ae217de!8m2!3d29.7204294!4d-95.7210968')
Trail.create(name: 'Twine', reservoir: 'barker', description: 'A neighborhood connector trail which runs from Cinco Ranch Equestrian Village neighborhood at the southeast corner of Fry Rd and Westheimer Pkwy to Freedom Park.  Parking is available at the Fort Bend County Freedom Park parking lots or in the neighborhood near the Ranger Point Ct. cul-de-sac, Bronco Bluff Ct. cul-de-sac or from the ditch running south from Westheimer Pkwy just east of Fry Rd.  Trail is inundated when Barker Reservoir water level exceeds 95’. ', notes: '', maplink: 'https://www.google.com/maps/place/Twine+Trail,+Katy,+TX+77450/@29.7331469,-95.7338977,17z/data=!3m1!4b1!4m5!3m4!1s0x8641209f98714095:0xb078b6edbcab968d!8m2!3d29.7331423!4d-95.731709')
Trail.create(name: 'Maud Marks Cut-off', reservoir: 'barker', description: 'Runs east-west through the old LH7 (Emil and Maud Marks) Ranch at the northwest corner of Barker Reservoir.  Not much shade, so a great winter time trail.  Access is 260 yards or 0.15 miles south of the gate on the George Bush Park (Barker Clodine) asphalt trail gate.  Parking is available on Barker Clodine just north of the gate.  A very pleasant low water crossing bridge is part of this trail.  Trail is inundated when Barker Reservoir water level exceeds 88’.  An “out and back” 0.84 miles one way.', notes: '', maplink: 'https://www.google.com/maps/place/Maud+Marks+Cut-off+Trail,+Houston,+TX+77094/@29.7735367,-95.6939435,17z/data=!3m1!4b1!4m5!3m4!1s0x8640d8d99e90dd0f:0x2196d781d2e0f8d2!8m2!3d29.7735321!4d-95.6917548')
